import request from '@/utils/request'; //查询派工单

export function queryRecords(query) {
  return request({
    url: '/mes/plan/work',
    method: 'get',
    params: query
  });
} // 派工单状态修改

export function changeStatus(data, workOrderCode) {
  return request({
    url: "/mes/plan/work/".concat(workOrderCode),
    method: 'patch',
    data: data
  });
}
